// CoursesPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const CoursesPage = () => {
  const courses = [
    { id: '1', name: 'Introducere în Java' },
    { id: '2', name: 'Programare Orientată pe Obiecte în Java' },
    { id: '3', name: 'Java pentru Aplicații Web' }
  ];

  return (
    <div>
      <h1>Cursuri</h1>
      <ul>
        {courses.map(course => (
          <li key={course.id}>
            <Link to={`/courses/${course.id}/lesson/0`}>{course.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CoursesPage;
